description:
Mary Walsh delivers boyfriend Kevin to a hospital for routine outpatient surgery. But when Mary returns to take him home, he's mysteriously vanished. An administrator can find no record of him, and a police search turns up nothing. Increasingly frantic, Mary's taken to staff psychiatrist Dr. Bensley, who pronounces her unstable. Now she must not only find her missing boyfriend, but prove her own sanity as well...

